import './App.css';
import {Container} from './components/index';
import {Header,Footer,Hero,MostPopular,} from './sections/index';


const App = ()=>{
    return(
        <>
        
        <Header/>
        
        <Container>
        <Hero/>
        <MostPopular/>
        <GamingLibrary/>
        </Container>
        
        <Footer/>
        </>
    )
};

export default App;
